import Foot from "../../assets/images/Foot.png";
import logo5 from "../../assets/images/foodie-logo-zip-file/png/logo5.png";

export default function Footer() {
  return (
    <div className="bg-black mt-20 relative h-200px pt-20">
    <div className="flex">
      <div className="w-150px ml-20 ">
        <img src={logo5} alt="" className="w-full h-full object-cover " />
        <p className="text-white mt-2 font-light">All Rights Reserved</p>
      </div>
     <div className="m">
       <p className="text-white">ads</p>
     </div>
    </div>

    </div>
  );
}
